import React from 'react';
import { Link } from 'react-router-dom';
import '../home.css';
import ProjectBox from './ProjectBox';

const Home = () => {
  return (
    <div>
      <h1 className="home-heading">Dale Warburton</h1>
      <p className="home-subheading">Welcome to my portfolio site,<br />I am a junior full-stack developer with<br />a passion for cloud.</p>
      <section>
        <h2 className="home-projects">Recent projects & Articles</h2>
        <p>Python Event Planner</p>
        <Link to="/projects/python-event-planner">
          <ProjectBox />
        </Link>
      </section>
    </div>
  );
};

export default Home;
